import React from "react";


const Home = () => {
    return (
        <header>
            <div>
                <h2>Save upto 80% on</h2>
                <h1>Your Car & Bike Comprehensive  Insurance Policy</h1>
            </div>
        </header>
    );
};

export default Home;
